import { useEffect } from "react";
import styles from "./FabricBoard.module.css";
import { fabric } from "fabric";

export default function FabricBoard() {
  useEffect(() => {
    var canvas = new fabric.Canvas("c");
    canvas.add(
      new fabric.Rect({
        width: 1000,
        height: 800,
        fill: "yellow",
        cornerColor: "pink",
      })
    );
  }, []);

  return (
    <div>
      <canvas id="c"></canvas>
    </div>
  );
}
